import React from 'react'
import Character from './Character'
import {withCharacter} from './MyProvider'

function CharContainer(props) {
    const mappedChar = this.props.char.map(data => <Character name={data.name} house={data.house} id={data._id} />)
    return(
        <div>
            {mappedChar}
        </div>
    )
}

export default withCharacter(CharContainer)
